Synopsis
Chaz Davenport is a dashing bachelor who owns what promises to become the hottest new nightclub in town--if only the lights would stay on. 

Surrounded by the sumptuous blues music he adores, and with his pick of the gorgeous women who perform their sensual dance numbers onstage every night, Chaz is the envy of every man. 

But with the city thrown into darkness by frequent blackouts and a menacing loan shark closing in, Chaz is in danger of losing the club--and far more. 

At the same time, he finds himself embroiled in a love triangle with the club's alluring star singer, Crystal, and a new arrival at the club--the mysterious and seductive chanteuse Madelaine. 

When people close to Chaz begin turning up dead, he doesn't know where to turn or whom to trust. 

And the harder he tries to uncover the truth, the further he's drawn into the darkness of lies and betrayal--a darkness as black as the city's streets during yet another power outage. Welcome to the Blues.


